import React from 'react';
import '../CSS/Add_Modal.css';

const AddModal: React.FC = () => {
  return (
    <div className="add-modal">
      <h2>Add Modal</h2>
      <p>新しい項目を追加するための情報がここに表示されます。</p>
    </div>
  );
};

export default AddModal;
